// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import "./RichHero.sol";

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

/**
* @title Exchange - Romance of the Three Kingdoms Exchange
*
* Version v1.1.0
*
*/

contract Exchange is Ownable {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;

    uint256 public constant PCT_BASE = 1e18;

    struct Order {
        address creator;
        uint256 price;
    }

    struct HeroDetail {
        RichHero.HeroDetail detail;
        Order order;
    }

    RichHero public HERO;
    IERC20 public EXCHANGE;
    address public feeRecipient = 0x8F3b8f3046dEb7C4E227dC0c6379051755Ba3142;

    EnumerableSet.UintSet private _tokenIds;

    mapping (uint256 => Order) public _orders;
    mapping (uint256 => uint256) private _roles;
    mapping (address => address) public _inviter;

    event Trading(RichHero.HeroDetail detail, uint256 price, address seller, address buyer);

    constructor(address token, address nft) {
        require(Address.isContract(token), "Token Invalid");
        require(Address.isContract(nft), "Nft Invalid");

        EXCHANGE = IERC20(token);
        HERO = RichHero(nft);
    }

    function getExchangeList(address owner) public view returns (HeroDetail[] memory) {
        uint256 len = _tokenIds.length();
        HeroDetail[] memory list = new HeroDetail[](len);
        uint256 resultLen;
        for (uint256 i = 0; i < len; i++) {
            uint256 tokenId = _tokenIds.at(i);
            if (!HERO.exists(tokenId)) {
                continue;
            }
            if ((owner != address(0)) && (_orders[tokenId].creator != owner)) {
                continue;
            }
            RichHero.HeroDetail memory hero = HERO.getHero(tokenId);
            HeroDetail memory detail = HeroDetail(hero, _orders[tokenId]);
            list[resultLen++] = detail;
        }
        HeroDetail[] memory result = new HeroDetail[](resultLen);
        for (uint256 i = 0; i < resultLen; i++) {
            result[i] = list[i];
        }
        return result;
    }

    function checkList() public {
        uint256 len = _tokenIds.length();
        for (uint256 i = 0; i < len; i++) {
            uint256 tokenId = _tokenIds.at(i);
            if (!HERO.exists(tokenId)) {
                _tokenIds.remove(tokenId);
                delete _orders[tokenId];
            }
        }
    }

    function put(uint256 tokenId, uint256 price) public {
        require(HERO.ownerOf(tokenId) == msg.sender, "Only Owner");
        require(price > 0, "Price Invalid");
        HERO.transferFrom(msg.sender, address(this), tokenId);
        _orders[tokenId] = Order(msg.sender, price);
        _tokenIds.add(tokenId);
    }

    function pull(uint256 tokenId) public {
        require(_orders[tokenId].creator == msg.sender, "Only Creator");
        HERO.transferFrom(address(this), msg.sender, tokenId);
        delete _orders[tokenId];
        _tokenIds.remove(tokenId);
    }

    function exchange(uint256 tokenId) public {
        require(_orders[tokenId].price > 0, "Order Not Exists");
        bool success = EXCHANGE.transferFrom(
            msg.sender, _orders[tokenId].creator, _orders[tokenId].price.mul(95).div(100)
        );
        require(success, "Transfer Invalid");
        success = EXCHANGE.transferFrom(
            msg.sender, feeRecipient, _orders[tokenId].price.mul(5).div(100)
        );
        require(success, "Transfer Invalid");

        HERO.transferFrom(address(this), msg.sender, tokenId);
        RichHero.HeroDetail memory hero = HERO.getHero(tokenId);
        emit Trading(hero, _orders[tokenId].price, _orders[tokenId].creator, msg.sender);
        delete _orders[tokenId];
        _tokenIds.remove(tokenId);
    }

    function setFeeRecipient(address newRecipient) public onlyOwner {
        feeRecipient = newRecipient;
    }
}
